/**
 * Global error handler.
 *
 * The purpose of this class is to help measure uncaught/async errors from within the app infra.
 *
 * @internal
 */
export default class SPGlobalErrorHandler {
    private static _quillLogSource;
    private static _ckLogSource;
    private static _genericLogSource;
    /**
     * Traces errors to _TraceLogger to measure the occurrence
     *
     * The signature matches window.onerror
     */
    static basicTracingHandler(message: string, filename?: string, lineno?: number, colno?: number, error?: Error): void;
    private static _isFromFile(filename, match);
    private static _logErrorFromFile(message, lineno, colno, error, eventName, logSource);
}
